import React from "react";
import "../styles/Services.css";

const Services = () => {
  return (
    <section className="services-section">
      <div className="services-container">
        <div className="service-card">
          <h3>Fisioterapia em casa</h3>
          <p>Conforto, segurança e resultados no seu lar.</p>
          <a href="#fisioterapia">Encontre o seu fisioterapeuta →</a>
        </div>
        <div className="service-card">
          <h3>Consulta Online</h3>
          <p>Flexibilidade, proximidade e avaliações remotas.</p>
          <a href="#consulta-online">Agende sua consulta online →</a>
        </div>
        <div className="service-card">
          <h3>Outros serviços ao domicílio</h3>
          <p>Psicologia e outras especialidades no conforto da sua casa.</p>
          <a href="#outros-servicos">Saiba mais →</a>
        </div>
      </div>
    </section>
  );
};

export default Services;
